import React from 'react'
import Child from './Child'
import { useState } from 'react'

function Users() {
    const [text, settext] = useState('Initial text')
    const changeFunc = (text) => {
        settext(text)
    }

    return (
        <div className="container">
            Parent Component
            {text}
            <Child change={changeFunc}/>
        </div>
    )
}

export default Users
